import Wrapper from "../../assets/wrappers/SharedLayout";
import { Navbar,BigSidebar, } from "../../components";
const SharedLayout = () => {
  return (
    <Wrapper>
      <nav>
        <Link to="add-job">add job </Link>
        <Link to="all-jobs">all jobs </Link>
      </nav>
      <Outlet />
    </Wrapper>
  );
};
export default SharedLayout;
